import React from 'react';
import tim from './images/Tim1.jpeg'
import './About.css';



const About = () => {
    return (
        <div className='about'>
            <div className='container'>
                <img src={tim} alt='Tim' />
                <div className='col-2'>
                    <h2>About</h2>
                    <span className='line'></span>
                    <p> I have had the privilege of working and living among America's most successful, wealthiest, and most powerful people. From senior government officials to individuals with companies and industries that affect not only the American economy but the world economy. Growing up in this type of environment for over 7 years has added tremendous value, experience and knowledge. It has positively shaped who I am, my skills, my approach to life and the way I think. I aim to pass on this valuable, life-changing experience and knowledge to anyone who wants to learn.
                    </p>
                    <p></p>
                </div>
            </div>
        </div>
    )
}

export default About
